import unittest
import json
import base64
from urllib.parse import unquote
from unittest.mock import Mock, MagicMock, patch
from requests import exceptions as rex
import party as pty
from trivia import Category, Difficulty, Match


class TriviaPartyTest(unittest.TestCase):
	@patch("requests.get")
	def __request_tests(self, tests, mock):
		for t in tests:
			mock.return_value = MagicMock()
			mock.return_value.json = lambda: json.loads(base64.b64decode(t["result"]).decode())

			trivia = pty.TriviaParty(
				category = t["category"],
				difficulty = t["difficulty"]
			)

			output = trivia.get_match()
			expected = ApiDataTest.get_expected_questions(t)

			mock.assert_called_with(t["url"])

			# check questions
			for q in output.questions:
				self.assertIn(q.question, [k["question"] for k in expected])
				self.assertIn(q.correct_answer, [k["correct_answer"] for k in expected])
				
				for a in q.answers:
					self.assertIn(a, [k for e in expected for k in e["answers"]])

			# check match data
			self.assertEqual(output.category.name, t["category"].name)
			self.assertEqual(output.difficulty, t["difficulty"])


	@patch("requests.get")
	def test_request_error(self, mock):
		exceptions = [
			rex.ConnectionError(), 
			rex.HTTPError(),
			rex.Timeout(),
			rex.TooManyRedirects()
		]
		
		for e in exceptions:
			mock.return_value.raiseError.side_effect = Mock(side_effect = e)

			trivia = pty.TriviaParty()
			output = trivia.get_match()

			self.assertIsNone(output)

	@patch("requests.get")
	def test_error_codes(self, mock):
		err_codes = ["1", "2"]
		
		for code in err_codes:
			mock.return_value = MagicMock()
			mock.return_value.json: lambda: f'{{"response_code":{code},"results":[]}}'

			trivia = pty.TriviaParty()
			output = trivia.get_match()

			self.assertIsNone(output)

	def test_category_generalknowledge(self):
		self.__request_tests(ApiDataTest.get_test_data(Category("General Knowledge")))
	
	def test_category_books(self):
		self.__request_tests(ApiDataTest.get_test_data(Category("Books")))
	
	def test_category_film(self):
		self.__request_tests(ApiDataTest.get_test_data(Category("Film")))
	
	def test_category_music(self):
		self.__request_tests(ApiDataTest.get_test_data(Category("Music")))
	
	def test_category_videogames(self):
		self.__request_tests(ApiDataTest.get_test_data(Category("Video Games")))
	
	def test_category_celebrities(self):
		self.__request_tests(ApiDataTest.get_test_data(Category("Celebrities")))
	
	def test_category_animals(self):
		self.__request_tests(ApiDataTest.get_test_data(Category("Animals")))
	
	def test_category_comics(self):
		self.__request_tests(ApiDataTest.get_test_data(Category("Comics")))
	
	def test_category_animeymanga(self):
		self.__request_tests(ApiDataTest.get_test_data(Category("Anime & Manga")))
	
	def test_category_cartoon(self):
		self.__request_tests(ApiDataTest.get_test_data(Category("Cartoon")))


class ApiDataTest:
	@classmethod
	def get_expected_questions(cls, data):
		result = json.loads(base64.b64decode(data["result"]).decode()) # get json data

		# get questions
		questions = [{
			"question" 			: unquote(r["question"]),
			"answers"			: [unquote(a) for a in r["incorrect_answers"]],
			"correct_answer"	: unquote(r["correct_answer"])
		 } for r in result["results"]]

		# add the correct answer into answers
		for q in questions:
			q["answers"].append(q["correct_answer"])

		return questions


